import React, { useEffect, useState } from "react";
const { saveUser } = require("../../../service/api");

const SignUp = () => {
  const [refresh, setRefresh] = useState(0);
  const [studentTableData, setStudentTableData] = useState({ student: [] });
  const [userFormData, setUserFormData] = useState({
    username: "",
    password: "",
    email: "",
  });

  const handleInputChange = (event) => {
    setStudentFormData({
      ...studentFormData,
      [event.target.name]: event.target.value,
    });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    saveUser(studentFormData).then((response) => {
      if (response.status === 200) {
        setRefresh(Math.random());
      }
    });
  };

  return (
    <>
      <div className="container-sm w-30">
        <form onSubmit={handleSubmit}>
          <div className="row">
            <label htmlFor="email" className="form-label">
              Email
            </label>
            <input
              type="text"
              placeholder="email"
              className="form-control"
              onChange={handleInputChange}
              name="email"
            ></input>
          </div>
          <div className="row">
            <label htmlFor="username" className="form-label">
              Username
            </label>
            <input
              type="text"
              placeholder="username"
              className="form-control"
              onChange={handleInputChange}
              name="username"
            ></input>
          </div>
          <div className="row">
            <label htmlFor="password" className="form-label">
              Password
            </label>
            <input
              type="text"
              placeholder="password"
              className="form-control"
              onChange={handleInputChange}
              name="password"
            ></input>
          </div>
          <div className="d-flex justify-content-center">
            <button type="submit" className="btn btn-dark btn-submit mb-4">
              Submit
            </button>
          </div>
        </form>
      </div>
    </>
  );
};

export default SignUp;
